/* eslint-disable import/no-anonymous-default-export */
import Card04 from "../Header/Carroussel/Card04/Card04";


import img01 from "../../../src/Foto/img/Bariloche .jpg";
import img08 from "../../../src/Foto/img/buenos"


export default()=>{
    return(

<inter className="internacional">
        <h3>Pacote de Viagem Internaconal</h3>
        <h3>Viagem em Promoção</h3>

   <Card04 Foto={img01 }  ></Card04>
   <Card04 Foto={img08 }  ></Card04>


   </inter>
    );
}
